INSERT INTO `zt_basicmeas`(`id`,`purpose`,`scope`,`object`,`name`,`code`,`unit`,`configure`,`params`,`definition`,`source`,`collectType`,`collectConf`,`execTime`,`collectedBy`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`order`,`deleted`) VALUES ('2','scale','project','userRequest','项目用户需求初始规模','pgmURInitScale','故事点或功能点','CREATE FUNCTION qc_pgmurinitscale($project int) returns float (10,2)
begin
    declare scale float(10,2) default 0;
    declare inited int default 0;
    select qc_cminited($project, \'URS\') into inited;
    IF inited = 1 THEN
    select qc_initscale($project, \'URS\',\'requestEst\') into scale;
    return scale;
    ELSE 
    return 0;
    END IF;
end','{\"$project\":{\"showName\":\"\\u6240\\u5c5e\\u9879\\u76ee\",\"varName\":\"$project\",\"varType\":\"select\",\"options\":\"project\",\"defaultValue\":\"\"}}','项目每个产品的第一个用户需求规格说明书基线版本的规模之和','从基线表中查询该项目下面每个产品的第一个用户需求规模说明书版本，然后查询对应的需求，求和。','crontab','{\"week\":\"1,2,3,4,5,6,0\",\"type\":\"week\"}','00:00','','system','0000-00-00 00:00:00','admin','2020-07-07 14:19:41','10','0');
INSERT INTO `zt_basicmeas`(`id`,`purpose`,`scope`,`object`,`name`,`code`,`unit`,`configure`,`params`,`definition`,`source`,`collectType`,`collectConf`,`execTime`,`collectedBy`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`order`,`deleted`) VALUES ('3','scale','project','softRequest','项目软件需求初始规模','pgmSRInitScale','故事点或功能点','CREATE FUNCTION qc_pgmsrinitscale($project int) returns float (10,2)
begin
    declare scale float (10,2) default 0;
    declare inited int default 0;
    select qc_cminited($project, \'SRS\') into inited;
    IF inited = 1 THEN
    select qc_initscale($project, \'SRS\',\'storyEst\') into scale ;
    return scale ;
    ELSE 
    return 0;
    END IF;
end','{\"$project\":{\"showName\":\"\\u6240\\u9700\\u9879\\u76ee\",\"varName\":\"$project\",\"varType\":\"select\",\"options\":\"project\",\"defaultValue\":\"\"}}','项目每个产品的第一个软件需求规格说明书基线版本的规模之和','从基线表中查询该项目下面每个产品的第一个软件需求规模说明书版本，然后查询对应的需求，求和。','crontab','{\"week\":\"1,2,3,4,5,6,0\",\"type\":\"week\"}','00:00','','system','0000-00-00 00:00:00','admin','2020-07-07 14:21:53','15','0');
INSERT INTO `zt_basicmeas`(`id`,`purpose`,`scope`,`object`,`name`,`code`,`unit`,`configure`,`params`,`definition`,`source`,`collectType`,`collectConf`,`execTime`,`collectedBy`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`order`,`deleted`) VALUES ('4','scale','project','userRequest','项目用户需求实时规模','pgmURRealScale','故事点或功能点','CREATE FUNCTION `qc_pgmurrealscale`($project int) RETURNS float (10,2)
BEGIN
  declare totalEstimate float(10,2) default 0;
  select CAST(sum(estimate) as DECIMAL(10,2)) as estimate from zt_story where project=$project and type=\'requirement\' and deleted=\'0\' and closedReason not in (\'subdivided\', \'duplicate\', \'willnotdo\', \'cancel\', \'bydesign\') into totalEstimate;
  return totalEstimate;
END','{\"$project\":{\"showName\":\"\\u6240\\u5c5e\\u9879\\u76ee\",\"varName\":\"$project\",\"varType\":\"select\",\"options\":\"project\",\"defaultValue\":\"\"}}','项目用户需求实际的规模','从需求表中查询该项目下的所有用户需求，对规模进行求和。','crontab','{\"week\":\"1,2,3,4,5,6,0\",\"type\":\"week\"}','00:00','','system','0000-00-00 00:00:00','admin','2020-07-07 14:22:17','20','0');
INSERT INTO `zt_basicmeas`(`id`,`purpose`,`scope`,`object`,`name`,`code`,`unit`,`configure`,`params`,`definition`,`source`,`collectType`,`collectConf`,`execTime`,`collectedBy`,`createdBy`,`createdDate`,`editedBy`,`editedDate`,`order`,`deleted`) VALUES ('5','scale','project','softRequest','项目软件需求实时规模','pgmSRRealScale','故事点或功能点','CREATE FUNCTION `qc_pgmsrrealscale`($project int) RETURNS float (10,2)
BEGIN
  declare totalEstimate float (10,2) default 0;
  select CAST(sum(estimate) as DECIMAL(10,2)) as estimate from zt_story where id in (select story from zt_projectstory where project=$project) and type=\'story\' and deleted=\'0\' and closedReason not in (\'subdivided\', \'duplicate\', \'willnotdo\', \'cancel\', \'bydesign\') into totalEstimate;
  return totalEstimate;
END','{\"$project\":{\"showName\":\"\\u6240\\u5c5e\\u9879\\u76ee\",\"varName\":\"$project\",\"varType\":false,\"options\":\"project\",\"defaultValue\":\"702\"}}','项目软件需求实际的规模','从需求表中查询该项目下的所有软件需求，对规模进行求和。','crontab','{\"week\":\"1,2,3,4,5,6,0\",\"type\":\"week\"}','00:00','','system','0000-00-00 00:00:00','admin','2020-07-07 14:28:01','25','0');
